(35, 35, 'produtos_taxonomy', 'Placas EPS (Isopor) para forro, excelente isolante térmico e decorativo\r\nDisponível em modelo liso e com textura\r\nDimensão padrão 1243x618mm com espessura de 20, 25, 30, 40, ou 50mm ou ainda podemos fabricar conforme sua necessidade', 0, 12),
