(32, 32, 'produtos_taxonomy', 'Sancas internas em EPS, fornecido em material de alta densidade, pode ser pintado ou aplicado massa acrílica, padrão comprimento 1000mm\r\nFazemos projetos sob medida', 0, 6),
(37, 37, 'produtos_taxonomy', '', 0, 0),
(33, 33, 'produtos_taxonomy', 'Moldura cimentícia em EPS revestido com argamassa, gerando grande resistência ao produto, para fins decorativos ou afim de esconder tubulações, calhas, telhados\r\nFazemos projetos sob medida como colunas falsas', 0, 7),
(39, 39, 'produtos_taxonomy', 'Fabricamos placas em Isopor para isolamento térmico em diversas medidas\r\nProduzimos também calhas para isolamento térmico de tubulações\r\nTudo em material auto extinguível', 0, 0),
(40, 40, 'produtos_taxonomy', 'Produzimos telhas em EPS para isolamento térmico de telhados, podendo ser coladas em telhas de aluzinco, fibrocimento.\r\nFabricadas nos modelos trapezoidal, ondulada ou bandeja conforme a necessidade', 0, 1);
